import React from 'react'

const Notifications = () => {
  return (
    <div className='max-w-7xl'>
        <div className='justify-between flex'>
            <div>
                <h1>Never miss an Update or Notification</h1>
            </div>
        </div>
    </div>
  )
}

export default Notifications
